        <Col md={6}>
            <img
              src="https://encrypted-tbn1.gstatic.com/shopping?q=tbn:ANd9GcTta0bdoFOnLtqS-TYj7uFJCAcATqtJ6l9sxYHQpIYpX-SmHwt_jwOGGZ27Qt-bS21442wOZ_tbuYQpA7vRyut6MNBlbPwuUQ"
              alt="Product"
